INSERT INTO `is_proxyconfs` VALUES (0,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\r\n<proxy-config>\r\n	<case id=\"_1\" pattern=\"^http://localhost(:[0-9]*)?/.*\" type=\"direct\" intranet=\"true\"/>\r\n	<default id=\"_2\" type=\"direct\" cacheLifeTime=\"10\" intranet=\"false\">\r\n		<headers>\r\n			<header>Connection</header>\r\n			<header>Date</header>\r\n			<header>Pragma</header>\r\n			<header>Upgrade</header>\r\n			<header>Via</header>\r\n			<header>Accept</header>\r\n			<header>Accept-Charset</header>\r\n			<header>Accept-Language</header>\r\n			<header>Authorization</header>\r\n			<header>Expect</header>\r\n			<header>From</header>\r\n			<header>Max-Forwards</header>\r\n			<header>Proxy-Authorization</header>\r\n			<header>Range</header>\r\n			<header>Referer</header>\r\n			<header>Te</header>\r\n			<header>User-Agent</header>\r\n			<header>Cookie</header>\r\n			<header>Content-Type</header>\r\n			<header>Content-Encoding</header>\r\n			<header>Transfer-Encoding</header>\r\n			<header>Content-Disposition</header>\r\n			<header>Cache-Control</header>\r\n			<header>If-Match</header>\r\n			<header>If-Modified-Since</header>\r\n			<header>If-None-Match</header>\r\n			<header>If-Range</header>\r\n			<header>If-Unmodified-Since</header>\r\n		</headers>\r\n	</default>\r\n</proxy-config>','1999-12-31 15:00:01');
INSERT INTO `is_searchengines` VALUES (0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<searchEngines>\r\n	<defaultSearch>\r\n		<!-- <searchEngine id=\"google\" defaultSelected=\"true\" title=\"Google\" retrieveUrl=\"http://www.google.com/search?hl=en&amp;q=\">\r\n			<countRule method=\"regexp\" value=\"(?:About)? ([0-9,]+) results|of about &lt;b&gt;([0-9,]+)&lt;/b&gt; for\"/>\r\n		</searchEngine> -->\r\n		<searchEngine id=\"bing\" defaultSelected=\"true\" title=\"Bing\" retrieveUrl=\"http://www.bing.com/search?mkt=en-US&amp;setlang=match&amp;q=\">\r\n			<countRule method=\"regexp\" value=\"([0-9,]+) results\"/>\r\n		</searchEngine>\r\n		<searchEngine id=\"excite\" defaultSelected=\"true\" title=\"excite\" retrieveUrl=\"http://msxml.excite.com/search/web?q=\">\r\n		</searchEngine>\r\n	</defaultSearch>\r\n	<rssSearch>\r\n		<searchEngine id=\"bingsite\" retrieveUrl=\"http://www.bing.com/search?mkt=en-US&amp;setlang=match&amp;q=site%3A$1%20\">\r\n			<rssPattern>^http://([^/]+)/.*</rssPattern>\r\n			<countRule method=\"regexp\" value=\"([0-9,]+) results\" />\r\n		</searchEngine>\r\n		<!-- <searchEngine id=\"googlesite\" retrieveUrl=\"http://www.google.com/search?hl=en&amp;q=site%3A$1%20\">\r\n			<rssPattern>^http://([^/]+)/.*</rssPattern>\r\n			<countRule method=\"regexp\" value=\"(?:About)? ([0-9,]+) results|of about &lt;b&gt;([0-9,]+)&lt;/b&gt; for\"/>\r\n		</searchEngine> -->\r\n	</rssSearch>\r\n</searchEngines>');
INSERT INTO `is_tablayouts` VALUES ('0',0,'default','defaultRole','OrganizationPrincipal','default','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<widgets uid=\"default\" tabId=\"0\" tabName=\"Home\" tabType=\"static\">\r\n	<panel type=\"StaticPanel\">\r\n		<widget column=\"1\" href=\"\" id=\"p_1_w_1\" title=\"infoScoop OpenSource site\" type=\"RssReader\">\r\n			<data>\r\n				<property name=\"url\">http://www.infoscoop.org/index.php/en/news.feed</property>\r\n			</data>\r\n		</widget>\r\n\r\n		<widget column=\"3\" href=\"\" id=\"p_1_w_5\" title=\"Calendar\" type=\"Calendar\" ignoreHeader=\"true\">\r\n			<data />\r\n		</widget>\r\n	</panel>\r\n	<panel type=\"DynamicPanel\" />\r\n</widgets>','<DIV>\r\n	<DIV style=\"FLOAT: left; WIDTH: 74.5%\">\r\n		<DIV style=\"HEIGHT: 190px\">\r\n			<DIV style=\"FLOAT: left; WIDTH: 100%; HEIGHT: 100%\">\r\n				<DIV id=\"p_1_w_1\" class=\"static_column\" style=\"MARGIN-LEFT: 2px; HEIGHT: 190px\"></DIV>\r\n			</DIV>\r\n		</DIV>\r\n	</DIV>\r\n	<DIV style=\"FLOAT: right; WIDTH: 25%; HEIGHT: 190px\">\r\n		<DIV id=\"p_1_w_5\" class=\"static_column\" style=\"MARGIN-LEFT: 2px; HEIGHT: 190px\"></DIV>\r\n	</DIV>\r\n</DIV>\r\n<DIV style=\"CLEAR: both; display:none;\"/>\r\n','-',0,0,0x00,NULL);
INSERT INTO `is_tablayouts` VALUES ('commandbar',0,'default','defaultRole','OrganizationPrincipal','default','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<widgets uid=\"default\" tabId=\"0\" tabName=\"\" tabType=\"static\" lastModified=\"\">\r\n	<panel type=\"StaticPanel\">\r\n		<widget column=\"3\" href=\"\" id=\"p_1_w_4\" title=\"Ticker\" type=\"Ticker\">\r\n			<data>\r\n				<property name=\"url\">http://www.infoscoop.org/index.php/en/news.feed</property> \r\n			</data>\r\n		</widget>\r\n		<widget id=\"p_1_w_6\" column=\"3\" title=\"Ranking\" type=\"Ranking\">\r\n			<data>\r\n			<property name=\"urls\"><![CDATA[\r\n				<urls>\r\n					<url title=\'Search Keyword Ranking\' url=\'http://localhost:8080/infoscoop/kwdsrv?baseDate=TODAY&amp;period=30&amp;rankingNum=20\'/>\r\n				</urls>\r\n			]]></property>\r\n			</data>\r\n		</widget>\r\n	</panel>\r\n</widgets>','<table cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n	<tr>\r\n		<td width=\"100%\"><div id=\"p_1_w_4\" class=\"commandbar-item\" outside=\"true\"></div></td>\r\n		<td><div id=\"p_1_w_6\" class=\"commandbar-item\"></div></td>\r\n		<td><div id=\"disabled_portal-change-fontsize\" disabledCommand=\"true\" class=\"commandbar-item\"><!--&lt;div id=\"portal-change-fontsize\"&gt;&lt;/div&gt;--></div></td>\r\n		<td><div id=\"portal-trash\" class=\"commandbar-item\"></div></td>\r\n		<td><div id=\"portal-preference\" class=\"commandbar-item\"></div></td>\r\n		<td><div id=\"disabled_portal-credential-list\" disabledCommand=\"true\" class=\"commandbar-item\"><!--&lt;div id=\"portal-credential-list\"&gt;&lt;/div&gt;--></div></td>\r\n		<td><div id=\"portal-admin-link\" class=\"commandbar-item\"></div></td>\r\n		<td><div id=\"disabled_portal-logout\" disabledCommand=\"true\" class=\"commandbar-item\"><!--&lt;div id=\"portal-logout\"&gt;&lt;/div&gt;--></div></td>\r\n		<td><div id=\"portal-searchform\" class=\"commandbar-item\" outside=\"true\"></div></td>\r\n	</tr>\r\n</table>','-',NULL,0,0x00,NULL);
