INSERT INTO `is_widgetconfs` VALUES ('MultiRssReader','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<widgetConfiguration autoRefresh=\"true\" icon=\"multi-rss-reader.gif\" type=\"MultiRssReader\" title=\"!{lb_MultiRssReader}\" backgroundColor=\"#FFFFFF\">\r\n	<WidgetPref datatype=\"bool\" display_name=\"!{lb_titleEdit}\" name=\"titleEdit\" value=\"true\"/>\r\n	<WidgetPref datatype=\"string\" display_name=\"!{lb_dateTimeFormat}\" name=\"dateTimeFormat\" value=\"yyyy/MM/dd HH:mm:ssZ\"/>\r\n	<WidgetPref datatype=\"bool\" display_name=\"!{lb_useAccessStat}\" name=\"useAccessStat\" value=\"true\"/>\r\n	<UserPref default_value=\"false\" display_name=\"!{lb_doLineFeed}\" datatype=\"bool\" name=\"doLineFeed\"/>\r\n	<UserPref default_value=\"true\" display_name=\"!{lb_doShowDatetime}\" datatype=\"bool\" name=\"showDatetime\"/>\r\n	<UserPref default_value=\"3\" display_name=\"!{lb_itemsnumDisplayName}\" datatype=\"hidden\" name=\"itemsnum\" staticDisabled=\"true\">\r\n		<EnumValue display_value=\"0\" value=\"0\"/>\r\n		<EnumValue display_value=\"1\" value=\"1\"/>\r\n		<EnumValue display_value=\"2\" value=\"2\"/>\r\n		<EnumValue display_value=\"3\" value=\"3\"/>\r\n		<EnumValue display_value=\"4\" value=\"4\"/>\r\n		<EnumValue display_value=\"5\" value=\"5\"/>\r\n		<EnumValue display_value=\"6\" value=\"6\"/>\r\n		<EnumValue display_value=\"7\" value=\"7\"/>\r\n		<EnumValue display_value=\"8\" value=\"8\"/>\r\n		<EnumValue display_value=\"9\" value=\"9\"/>\r\n		<EnumValue display_value=\"10\" value=\"10\"/>\r\n	</UserPref>\r\n	<UserPref default_value=\"category\" display_name=\"!{lb_displayModeKey}\" datatype=\"hidden\" name=\"displayMode\"/>\r\n	<UserPref default_value=\"false\" display_name=\"!{lb_iframeview}\" datatype=\"hidden\" name=\"showLatestNews\"/>\r\n	<UserPref default_value=\"true\" datatype=\"hidden\" name=\"openWidget\"/>\r\n	<UserPref default_value=\"false\" datatype=\"hidden\" name=\"iframeview\"/>\r\n	<UserPref default_value=\"scroll\" display_name=\"!{lb_scr